import React from "react";
import NavigationBar from "../../components/NavigationBar";

const Home = () => {
  return (
    <>
      <div
        className="container d-flex justify-content-center align-items-center text-center"
        style={{ height: "100vh" }}
      >
        <NavigationBar />
        <div className="row">
          <div className="col-lg-6">
            <input type="text" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
